import React, { Component } from 'react'
import Carousel from 'react-elastic-carousel'
import ItemImage from './ItemImage'
class Carous extends Component {

    render() {
        return (
            <Carousel>
                <img src={this.props.ItemImage[0]}></img>
                <img src={this.props.ItemImage[1]}></img>
                <img src={this.props.ItemImage[2]}></img>
                <img src={this.props.ItemImage[3]}></img>

            </Carousel>
        )
    }
}
export default Carous
